<META HTTP-EQUIV="assetid" CONTENT="HP05206409"><META NAME="lcid" CONTENT="1033"><title>Data format error; can't paste.</title><link rel="stylesheet" type="text/css" href="office10.css"><script type="text/javascript" language="Javascript" src="ExpCollapse.js"></script><script type="text/javascript" language="JavaScript" src="inline.js"></script></head><body><h1>Data format error; can't paste.</h1><p>Microsoft Query can't paste the data from the Clipboard because there may not be enough free memory.</p><p>Try closing other windows in Microsoft Query or closing other programs. If the error repeats, restart Microsoft Windows and try to copy and paste the data again.</p></body></html>
